import React, { Component } from 'react';
import WeatherPage from './weather/WeatherPage'


 class Weather extends Component {
    constructor(props) {
      super(props)
    
      this.state = { 
        "coord": {
            "lon": -1.09,
            "lat": 51.26
        },
        "weather": [{
            "id": 803,
            "main": "Clouds",
            "description": "broken clouds",
            "icon": "04d"
        }],
        "base": "stations",
        "main": {
            "temp": 292.02,
            "pressure": 1017,
            "humidity": 72,
            "temp_min": 289.15,
            "temp_max": 294.26
        },
        "visibility": 10000,
        "wind": {
            "speed": 4.6,
            "deg": 170
        },
        "clouds": {
            "all": 75
        },
        "dt": 1562525402,
        "sys": {
            "type": 1,
            "id": 1499,
            "message": 0.0087,
            "country": "GB",
            "sunrise": 1562471827,
            "sunset": 1562530855
        },
        "timezone": 3600,
        "id": 2656192,
        "name": "Basingstoke",
        "cod": 200
    
                    
                   }
    }
    
  render() {
    return (
      <div>
        <h2>Weather</h2>
      {this.state.name}<span>Temp:</span>{this.state.main.temp}
      
      </div>
    )
  }
}
export default Weather
